import React, { useState } from 'react';

   function JobListing() {
     const [job, setJob] = useState({ title: '', description: '' });

     const handleChange = (e) => {
       setJob({ ...job, [e.target.name]: e.target.value });
     };

     const handleSubmit = (e) => {
       e.preventDefault();
       // Call API to save job listing
     };

     return (
       <div>
         <h1>Create/Edit Job Listing</h1>
         <form onSubmit={handleSubmit}>
           <input name="title" value={job.title} onChange={handleChange} placeholder="Job Title" />
           <input name="description" value={job.description} onChange={handleChange} placeholder="Job Description" />
           <button type="submit">Save</button>
         </form>
       </div>
     );
   }

   export default JobListing;
